import react from "react";
import "./userlist.css";
import user from "./pages/user";
import Useritem from "./useritem";

const Userlist = (props) => {


  return (
    <ul className="users-list">
      {props.items.map((user) => (
        <Useritem
          key={user.id}
          id={user.id}
          image={user.image}
          name={user.name}
          placeCount={user.places}
        />
      ))}
    </ul>
  );
};

export default Userlist;
